import axie from "../tile.jpeg";
import { BrowserRouter as Router, Link } from "react-router-dom";
import { GetIpfsUrlFromPinata } from "../utils";
import "./NFTTitle.css";

function NFTTile(data) {
  const newTo = {
    pathname: "/nftPage/" + data.data.tokenId,
  };

  const IPFSUrl = GetIpfsUrlFromPinata(data.data.image);

  return (
    //   <div className="border-2 ml-12 mt-5 mb-12 flex flex-col items-center rounded-lg w-48 md:w-72 shadow-2xl">
    //     <img
    //       src={IPFSUrl}
    //       alt=""
    //       className="w-72 h-80 rounded-lg object-cover"
    //       crossOrigin="anonymous"
    //     />
    //     <div className="text-white w-full p-2 bg-gradient-to-t from-[#454545] to-transparent rounded-lg pt-5 -mt-20">
    //       <strong className="text-xl">{data.data.name}</strong>
    //       <p className="display-inline">{data.data.description}</p>
    //     </div>
    //   </div>

    <div class="item-style">
      <div class="thumb">
        <Link to={newTo}>
          <a href="#">
            <img src={IPFSUrl} />
          </a>
        </Link>
        <button class="reaction-btn">
          <i class="ri-heart-fill"></i>

          <span>NFT</span>
        </button>
      </div>

      <div class="content">
        <h3 class="title">
          <a href="#">
            <strong>{data.data.name}</strong>
          </a>
        </h3>

        <div class="profile d-flex-center">
          <i class="ri-shield-check-fill"></i>
        </div>

        <div class="product-owner d-flex-center">
          <span class="bid-owner">{data.data.description}</span>
          <span class="biding-price d-flex-between">
            <i class="ri-arrow-up-line"></i>
          </span>
        </div>

        <div class="product-buy d-flex-between">
          <a href="#" class="btn">
            <span>
              <i class="ri-time-line"></i>{" "}
              <strong className="text-slate-100">{data.data.price}</strong>
            </span>
          </a>
          <a href="#" class="btn btn-cart btn-outline">
            <Link to={newTo}>
              <span>Buy</span>
            </Link>
          </a>
        </div>
      </div>
    </div>
  );
}

export default NFTTile;
